import React from "react";
import { Button, Icon, Image, Modal } from "semantic-ui-react";
import "semantic-ui-css/semantic.min.css";

const WorkingHistory = () => {
  const [open, setOpen] = React.useState(false);

  return (
    <Modal
      open={open}
      onClose={() => setOpen(false)}
      onOpen={() => setOpen(true)}
      trigger={<Button>There's Gotta be More Than This...Right?</Button>}
    >
      <Modal.Header>So What's Your Story?</Modal.Header>
      <Modal.Content image scrolling>
        <Image
          size="medium"
          src="https://openclipart.org/image/2000px/155107"
          wrapped
        />

        <Modal.Description>
          <p>
            I'll be HAPPY to tell ya
            <br />
            <li>
              I have a Masters Degree in Special Education with a focus in
              Applied Behavioral Analysis
            </li>
            <li>
              I've worked for various mental health organizations and school districts; serving those
              in need at home, school and the community!{" "}
            </li>
            <li>
              My expertise was(at first...) the analysis of human behavior. I
              worked with clients and used this data to help individuals work through their
              problems utilizing custom built solutions that work specifically FOR THEM!{" "}
            </li>
            <li></li>
          </p>

          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image
            src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
            style={{ marginBottom: 10 }}
          />
          <Image src="https://react.semantic-ui.com/images/wireframe/paragraph.png" />
        </Modal.Description>
      </Modal.Content>
      <Modal.Actions>
        <Button onClick={() => setOpen(false)} primary>
          Proceed <Icon name="chevron right" />
        </Button>
      </Modal.Actions>
    </Modal>
  );
};

export default WorkingHistory;
